iable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"945957","type":"CustomJS"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"945834","type":"BoxAnnotation"},{"attributes":{},"id":"945831","type":"RedoTool"},{"attributes":{},"id":"945616","type":"DataRange1d"},{"attributes":{},"id":"945704","type":"UnionRenderers"},{"attributes":{},"id":"945627","type":"BasicTicker"},{"attributes":{"label":{"value":"Trades (1228)"},"renderers":[{"id":"945884"}]},"id":"945901","type":"LegendItem"},{"attributes":{"format":"0,0.[00]%"},"id":"945661","type":"NumeralTickFormatter"},{"attributes":{"axis":{"id":"945819"},"coordinates":null,"group":null,"ticker":null},"id":"945822","type":"Grid"},{"attributes":{"data":{"Close":{"__ndarray__":"mpmZmZlZOEDXo3A9Chc4QJqZmZmZGThAKVyPwvWoOEBxPQrXo7A4QJqZmZmZ2ThAmpmZmZnZOEA9CtejcP04QClcj8L1aDlA4XoUrkdhOEBxPQrXo3A4QJqZmZmZWThAFK5H4XpUOEAK16NwPUo4QArXo3A9SjhAexSuR+F6OEAfhetRuJ44QNejcD0KlzhAPQrXo3C9OEDsUbgehes4QClcj8L1KDlAKVyPwvWoOUCuR+F6FO45QK5H4XoU7jlA7FG4HoUrOkDXo3A9Clc6QIXrUbgehTpAAAAAAADAOkAUrkfhetQ6QFyPwvUo3DpAuB6F61G4OkApXI/C9ag6QLgehetR+DpAMzMzMzMzO0D2KFyPwjU7QMP1KFyPAjtAexSuR+E6
